import React from "react";
import { Select } from "antd";

interface SelectRickProps {
  onSelect: (value: string) => void;
  onSelectValue: (value: string | null) => void;
}

const SelectRick: React.FC<SelectRickProps> = ({ onSelect, onSelectValue }) => {
  const handleChange = (value: string) => {
    onSelect(value);
    onSelectValue(value);
  };

  return (
    <Select
      defaultValue="Status"
      style={{ width: 200 }}
      onChange={handleChange}
      options={[
        {
          label: "Status",
          options: [
            { label: "Alive", value: "alive", key: "status-alive" },
            { label: "Dead", value: "dead", key: "status-dead" },
            { label: "Unknown", value: "unknown", key: "status-unknown" },
          ],
          key: "status-options",
        },
        {
          label: "Gender",
          options: [
            { label: "Male", value: "male", key: "gender-male" },
            { label: "Female", value: "female", key: "gender-female" },
            {
              label: "Genderless",
              value: "genderless",
              key: "Gender-genderless",
            },
            { label: "Unknown", value: "unknown", key: "gender-unknown" },
          ],
          key: "gender-options",
        },
      ]}
    />
  );
};

export default SelectRick;
